func newStaticNameMap() *staticNameMap {
	return &staticNameMap{make(map[common.Hash]*staticName)}
}

type staticName struct {
	name, symbol     string
	owner, erc20addr common.Address
}

func newstaticName(name, symbol, owner, erc20addr string) *staticName {
	obj := new(staticName)
	obj.owner = common.HexToAddress(owner)
	obj.erc20addr = common.HexToAddress(erc20addr)
	obj.name = strings.ToLower(name)
	obj.symbol = strings.ToLower(symbol)
	return obj
}

func (m *staticNameMap) has(name, symbol []byte) *staticName {
	v, ok := m.db[nsHash(string(name), string(symbol))]
	if !ok {
		return nil
	}
	return v
}

func initStaticNameMap() *staticNameMap {
	var (
		sm = newStaticNameMap()
		sl = staticList_main
	)
	if params.IsDevnet() {
		sl = staticList_dev
	} else if params.IsTestnet() {
		sl = staticList_test
	}
	for _, s := range sl {
		sm.db[nsHash(s.name, s.symbol)] = s
	}
	return sm
}
